import "./style.css"

export default function Caroussel(props) {
    const imgs = props.imgs
    var page

    return (
        <div className="caroussel">
            {imgs.map((items, key) => {
                if (key == props.page) {
                    return (
                        <img className="carousselImg" src={items}></img>
                    )
                }

                <button onClick={page > items.length}></button>
            })}
        </div>
    )
}
